import React from 'react'
const SearchFilter = ({location}, {bed}) => {
    // console.log(location);
    return (
        <div className="row my-5">
            <div className="col">
                <h4 className="bottom-bottom">Filters</h4>
            </div>
            <div className="col-sm-12 my-2">
                <label htmlFor="name">Name</label>
                <input type="text" className="form-control" id="name"/> 
            </div>

            <div className="col-sm-12 my-2">
                <label htmlFor="date">When to move in</label>
                <input type="date" className="form-control" id="date"/>
            </div>

            <div className="col-sm-12 my-2">
                <label htmlFor="price">Price</label>
                <select className="form-control" id="price">
                        <option value="">-Select-</option>
                </select>                 
            </div>

            <div className="col-sm-12 my-2">
                <label htmlFor="bed">Beds</label>
                <select className="form-control" id="bed">
                        <option value="">-Select-</option>
                        {bed.map((beds) => {
                            return (
                                <option value={beds} key={beds}>
                                    {beds}
                                </option>
                            );
                        })}
                </select>                 
            </div>

            <div className="col-sm-12 my-2">
                <label htmlFor="location">Location</label>
                <select className="form-control" id="loc">
                        <option value="">-Select-</option>
                        {location.map((loc) => {
                            return (
                                <option value={loc} key={loc}>
                                    {loc}
                                </option>
                            );
                        })}
                </select>                 
            </div>
        </div>
    )
}

export default SearchFilter;
